import React, { useEffect, useState } from "react";

function patch_delete() {

    const [animals, setAnimals] = useState([])

    useEffect(() => {
        fetch("http://localhost:3000/animals")
            .then((resp) => resp.json())
            .then((data) => setAnimals(data))
    }, [])

    return (
        <>
        <h1>hello world</h1></>
    );
}

export default patch_delete;
